import React from "react";

const AssignedTask = React.lazy(()=>import('./assigned/assigned'));
const CancelledTask = React.lazy(()=>import('./cancelled/cancelled'));
const CompletedTask = React.lazy(()=>import('./completed/completed'));
const TaskInProgress = React.lazy(()=>import('./in-progress/progress'));
const TaskBeingRedone = React.lazy(()=>import('./Redones/redones'));
const NewTaskSubmited = React.lazy(()=>import('./submited/submited'));

const TaskManagement = ()=>{
    return <>
    <ul class="nav nav-tabs">
    <li class="nav-item">

      <a class="nav-link active" href="javascript:void(0)">New Submited</a>

  </li>
  <li class="nav-item">

      <a class="nav-link" href="javascript:void(0)">Assigned Orders</a>

  </li>
  <li class="nav-item">

  <a class="nav-link" href="javascript:void(0)">Orders In Progress</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="javascript:void(0)">Cancelled Orders</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="javascript:void(0)">Revisions</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="javascript:void(0)">Completed Orders</a>
  </li>

</ul>
  </>
}

export default TaskManagement;
